// import Header from "./header/Header";
// import Home from "./Home";


function Socials() {
  return (
    <div className="socials">
      <div class="container">
        <div class="row align-items-center my-5">
          <div class="col-lg-7">
          </div>
            <div class="col-lg-5">
              <h1 class="font-weight-light">HEXverse</h1>
            </div>
        </div>
      </div>
          <body>
            <SidebarContent>
              <div class="header">
              <ul>
              <li><b>Socials Sidebar</b></li>
              <li>Friends Online</li>
              </ul>
              </div>
            </SidebarContent>

            <MenuItem icon={<FaGem />}>
              <NavLink className="nav-link" to="/trailmap">
                Trailmap    
              </NavLink>
            </MenuItem>
          </body>
    </div>
  );
}

export default Socials;
